import React ,{useState,useEffect} from 'react'

const LoggedUser = () => {

  const [loggedUser,setLoggedUser] = useState('')

  const fetchData = async () =>{
    fetch("/LoggedUser")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setLoggedUser(data)
      })
  }

  useEffect(() => {
    fetchData()
  }, [])

  console.log(loggedUser);

  return (
    <div>
      <h1>Hello logged user</h1>
    </div>
  )
}

export default LoggedUser
